#!/usr/bin/env bash
###
# install-tf2-sniper-sounds.sh
# Self-contained installer for TF2 Sniper sound effects for Claude Code hooks.
# All 15 .wav files are embedded (base64) — no external downloads needed.
#
# Events:
#   SessionStart      → Battle cry / cheer sounds
#   UserPromptSubmit  → Positive vocalizations / good job / yes / thanks
#   Stop              → Special completed / domination / laugh sounds
#   Notification      → Jeers / battle cry (permission prompts only)
#
# Prerequisites:
#   - macOS (uses afplay + base64 -D)
#
# Usage: bash install-tf2-sniper-sounds.sh
###
set -euo pipefail

SOUNDS_DIR="$HOME/.claude/hooks/sounds/tf2_sniper"
mkdir -p "$SOUNDS_DIR"

echo "Extracting 15 TF2 Sniper sound files..."

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Sniper_battlecry01.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Sniper_battlecry03.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Sniper_cheers01.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Sniper_domination01.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Sniper_domination09.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Sniper_goodjob01.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Sniper_jeers01.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Sniper_laughlong01.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Sniper_laughlong02.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Sniper_positivevocalization01.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Sniper_positivevocalization02.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Sniper_specialcompleted01.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Sniper_specialcompleted07.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Sniper_thanks01.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Sniper_yes01.wav"

B64EOF

echo ""
echo "Done! TF2 Sniper sounds installed to $SOUNDS_DIR"
echo "To test: afplay $SOUNDS_DIR/Sniper_battlecry01.wav"
